import ReturnValiDExchange from './ValidExchange';
import { useNavigate } from 'react-router-dom';

// Return Transaction view
export default function ValidExchAngeDollArs() {

 const navigation = useNavigate();
 React.useEffect(() => {
  JSON.parse(window.localStorage.getItem('ACTIVE')) != true && navigation('/');
 }, []);

 return (
  <ReturnValiDExchange />
 );
};
